	function Closeletwo(n){
	     
		 document.getElementById("cir2_" + n).setAttribute("style", "visibility: visible");
		 if(n==1){
		 document.getElementById("mapI1").setAttribute("class","fil10");
		 document.getElementById("mapI2").setAttribute("class","fil11");}
		 else if (n==2){
		 document.getElementById("mapII1").setAttribute("class","fil8");
		 document.getElementById("mapII2").setAttribute("class","fil7");
		 document.getElementById("mapII3").setAttribute("class","fil23");
		 document.getElementById("mapII4").setAttribute("class","fil15");
		 document.getElementById("mapII5").setAttribute("class","fil21");
		 document.getElementById("mapII6").setAttribute("class","fil6");
		 document.getElementById("mapII7").setAttribute("class","fil20");
		 document.getElementById("mapII8").setAttribute("class","fil9");}
		
		 else if (n==4){
		 document.getElementById("mapIV1").setAttribute("class","fil12");
		 document.getElementById("mapIV2").setAttribute("class","fil13");}
		 else if (n==5){
		 document.getElementById("mapV1").setAttribute("class","fil16");
		 document.getElementById("mapV2").setAttribute("class","fil17");
		 document.getElementById("mapV3").setAttribute("class","fil19");
		 document.getElementById("mapV4").setAttribute("class","fil18");}
	}
	function Hightlight(evt) {
         var object = evt.target;
         var cls = object.id;
		 
         var objectMap = document.getElementById("map"+cls);
		 ocls = objectMap.getAttribute("class") || object.className;
         objectMap.setAttribute("class","fil100");
   }
   function Recover(evt) {
         var object = evt.target;
		 var cls = object.id;
         var objectMap = document.getElementById("map"+cls);
		 objectMap.setAttribute("class",ocls);
	}
	 function Hght(evt,n) {
         var object = evt.target;
         var cls = object.id;
		 for(var i=1;i<9;i++){
         var objectMap = document.getElementById("map"+cls+i);
		 ocls = objectMap.getAttribute("class") || object.className;
         objectMap.setAttribute("class","fil100");
		 }
   }
   function Rver(evt,n) {
   if(document.getElementById("cir2_" + n).style.visibility=="hidden")
   {
   if(n==1){
		 document.getElementById("mapI1").setAttribute("class","fil28");
