		 else if (n==5){
		 document.getElementById("mapV1").setAttribute("class","fil16");
		 document.getElementById("mapV2").setAttribute("class","fil17");
		 document.getElementById("mapV3").setAttribute("class","fil19");
		 document.getElementById("mapV4").setAttribute("class","fil18");
